// Home.js
import React from 'react';

function Home({user}) {
  return (
    <section className="py-16 bg-gray-100">
      <div className="container mx-auto text-center">
        {user? <h3>Logged in as {user.username}</h3> : null}
        <h2 className="text-3xl font-bold mb-4">Welcome to Have Fun Tattoo</h2>
        <p className="text-lg">Express yourself with our talented artists.</p>
      </div>
    </section>
  );
}

export default Home;
